import React, { Component } from 'react';

class Formulario extends Component {

  render() {

    return (
        <form className="col-8">
          <legend className="text-center">Crear Nuevo Post</legend>
          <div className="form-group">
            <label>Titulo del post:</label>
            <input type="text" className="form-control" placeholder="Titulo del post"/>
          </div>
          <div className="form-group">
            <label>Contenido del post:</label>
            <textarea className="form-control" placeholder="Contenido del post"></textarea>
          </div>
          <button type="submit" className="btn btn-primary">Crear Post</button>
        </form>
    );
  }
}

export default Formulario;
